import React from 'react';
import ReactDOM from 'react-dom';
import {BrowserRouter as Router, Link } from 'react-router-dom';
import Topbar from './topBar';
import './App.css';

export default class homepage extends React.Component {
  render() {
    return (
    <Router>
        <div>
          <Topbar /> {/* Render your custom TopBar component */}
          <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: 'calc(100vh - 50px)', backgroundColor: '#f0f0f0' }}>
            <Link to="/fight" style={{ textDecoration: 'none' }}>
              <button style={{ fontSize: '28px', padding: '15px 25px', backgroundColor: '#ff4500', color: '#fff', borderRadius: '10px', border: 'none', cursor: 'pointer' }}>Fight</button>
            </Link>
          </div>

        </div>
      </Router>
    );
  }
}
